$(document).ready(()=>{$("#tester").click(n=>{n.preventDefault();var i=$("form").first(),t={};i.serializeArray().map(n=>t[n.name]=n.value);t.spostValues!=undefined&&t.spostValues.length>0&&(t.PostValues=JSON.parse(t.spostValues));$("#loading").show("fast");$.post("/api/TestSiteSearch",t,function(n){$("#loading").hide("fast",function(){$(this).attr("style","display: none!important;");$("#messageTitle").text("Reponse");let t=$("#messageBody");t.text("");t.append($("<p>").text("La recherche "+n.search+" à donnée "+n.nb_result+" résultat(s)."));t.append($("<p>").text("-1 signifie qu'il y as une erreur, 0 = pas de résultat ou résultat inateignable"));t.append($("<p>").text("Le contenue HTML de la page de résultat se trouve dans la console si le nombre de résultat est <= 0."));t.append($("<p>").text("Cliquez ici pour ouvrir la page de résultat dans un autre onglet.").attr("onClick",n.js).attr("style","cursor: pointer;"));n.nb_result<=0&&console.log(n.pageHTML);$("#dialogMessage").modal("show")})}).fail(n=>{console.log(n.responseText),$("#loading").hide("fast",function(){$(this).attr("style","display: none!important;");$("#messageTitle").text("Erreur");$("#messageBody").text(n.responseText);$("#dialogMessage").modal("show")})})})});